import { DataTable, Table } from '@primer/react/experimental';
import { Label, LabelGroup, RelativeTime } from '@primer/react';

export function AccessTokens() {
  const data = [
    {
      name: 'example-repo',
      type: 'Private',
      updatedAt: <RelativeTime date={new Date()} />,
    },
    {
      name: 'example-repo',
      type: 'Private',
      updatedAt: <RelativeTime date={new Date()} />,
    },
    {
      name: 'example-repo',
      type: 'Private',
      updatedAt: <RelativeTime date={new Date()} />,
    },
    {
      name: 'example-repo',
      type: 'Private',
      updatedAt: <RelativeTime date={new Date()} />,
    },
    {
      name: 'example-repo',
      type: 'Private',
      updatedAt: <RelativeTime date={new Date()} />,
    },
  ];

  return (
    <Table.Container>
      <Table.Title
        as='h2'
        id='repositories'
      >
        Repositories
      </Table.Title>
      <Table.Subtitle
        as='p'
        id='repositories-subtitle'
      >
        A subtitle could appear here to give extra context to the data.
      </Table.Subtitle>
      <DataTable
        data={data}
        columns={[
          {
            header: 'Repository',
            field: 'name',
            rowHeader: true,
            renderCell: (row) => (
              <LabelGroup>
                <Label>{row.name}</Label>
              </LabelGroup>
            ),
          },
          {
            header: 'Type',
            field: 'type',
            renderCell: 'Row',
          },
          {
            header: 'Updated',
            field: 'updatedAt',
            renderCell: 'Row',
          },
        ]}
      />
    </Table.Container>
  );
}
